import Grid from '@material-ui/core/Grid';
import Container from '@material-ui/core/Container';

const SecondNavbar = () => {
	return (
		<Grid container className='second-navbar'>
			<Container>
				<Grid item>some</Grid>
			</Container>
		</Grid>
	);
};

export default SecondNavbar;
